import { BrowserRouter, Navigate, Route, Routes } from 'react-router-dom';
import logo from '../logo.svg';
import './App.scss';
import HomePage from './HomePage';
import NavBar from './NavBar';


function App() {
  return (
    <BrowserRouter>
      <NavBar />
      <Routes>
        <Route path='/' element={<HomePage />} />
        </Routes>
  </BrowserRouter>
  );
}

export default App;
